import React from 'react';
import { Link } from 'react-router-dom';
import { FaStar } from 'react-icons/fa';
import service1Img from './assets/service1.jpeg';
import service2Img from './assets/service2.jpeg';
import service3Img from './assets/service3.jpeg';

const ServiceCards = () => {
  const services = [
    {
      id: 1,
      title: 'HouseKeeping',
      image: service1Img,
      rating: 4.5,
      price: '$100',
    },
    {
      id: 2,
      title: 'ChildCare',
      image: service2Img,
      rating: 4.7,
      price: '$150',
    },
    {
      id: 3,
      title: 'Laundry',
      image: service3Img,
      rating: 4.3,
      price: '$120',
    },
  ];

  return (
    <div className="mx-4 my-6">
      <h2 className="text-3xl font-semibold text-center mb-6">Our Premium Services</h2>
      <div className="grid grid-cols-3 gap-6">
        {services.map((service) => (
          <Link to="/in-progress" key={service.id}>
            <div
              className="flex flex-col bg-gradient-to-br from-purple-200 to-blue-200 p-4 border rounded-lg shadow-lg transform transition-transform duration-200 hover:scale-105 hover:shadow-xl"
            >
              <img src={service.image} alt={service.title} className="w-full h-48 object-cover mb-4 rounded-lg" />
              <h3 className="text-2xl font-bold mb-2">{service.title}</h3>
              <div className="flex justify-between items-center mt-auto">
                <div className="flex items-center space-x-2">
                  <FaStar className="text-yellow-500" />
                  <span className="text-yellow-500 font-medium">{service.rating}</span>
                </div>
                <span className="text-xl font-semibold text-purple-600">{service.price}</span>
              </div>
            </div>
          </Link>
        ))}
      </div>
    </div>
  );
};

export default ServiceCards;
